script:
reset();

const size = { x: 32, y: 64, z: 32 };
const origin = { x: size.x * -0.5, z: size.z * -0.5 - 8 };
const walls = 12;
const noise = new SimplexNoise('SuperSeed');

box(origin.x - 1, 0, origin.z - 1, size.x + 2, walls + 1, size.z + 2, 2);
box(origin.x, 0, origin.z, size.x, walls, 1, 1);
box(origin.x, 0, origin.z, size.x, walls, size.z, 1);
box(origin.x + 1, 1, origin.z + 1, size.x - 2, walls - 2, size.z - 2, 0);
for (let z = 24; z < size.z; z += 8) {
  for (let x = 24; x < size.x; x += 8) {
    box(origin.x + x, walls - 1, origin.z + z, 2, 2, 2, 0);
  }
}
cylinder(
  origin.x + 1, walls * 0.5 - 1, origin.z + 6,
  'x', walls * 0.5, size.x * 0.6, 1
);
cylinder(
  origin.x + 1, walls * 0.5 - 1, origin.z + 6,
  'x', walls * 0.5 - 2, size.x * 0.6, 0
);

const elevator = {
  x: origin.x + 13,
  y: 0,
  z: origin.z + size.z,
};

box(
  elevator.x, elevator.y, elevator.z,
  6, 7, 6,
  2
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  4, 5, 4,
  0
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z - 2,
  4, 5, 1,
  1
);
box(
  elevator.x + 2, elevator.y + 1, elevator.z - 2,
  2, 4, 3,
  0
);
